import React, { useEffect, useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import AlimentoDetalle from './AlimentoDetalle';

function App() {
  const [alimentos, setAlimentos] = useState([]);
  const [query, setQuery] = useState('');

  useEffect(() => {
    fetch(`http://localhost:8000/api/alimentos/?search=${query}`)
      .then(response => response.json())
      .then(data => setAlimentos(data))
      .catch(error => console.error('Error:', error));
  }, [query]);

  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Alimentos</h1>
          <input
            type="text"
            value={query}
            onChange={(e) => setQuery(e.target.value)}
          />
          <ul>
            {alimentos.map(alimento => (
              <li key={alimento.id}>
                <Link to={`/alimento/${alimento.id}`}>{alimento.nombre}</Link>
              </li>
            ))}
          </ul>
        </header>
        <Switch>
          <Route path="/" exact>
            {/* Aquí puedes colocar el contenido que deseas mostrar en la ruta raíz */}
          </Route>
          <Route path="/alimento/:id" component={AlimentoDetalle} />
        </Switch>
      </div>
    </Router>
  );
}

export default App
